As with all things Rust, we'll first want to create a cargo project. cargo new --lib cxx-qt-getting-started Note the --lib option here. It is important that we create a static library in Rust, rather than an executable. We'll discuss details of this later, when we integrate our Rust project with CMake . As outlined in the previous section, to define a new QObject subclass, we'll need to create a Rust module. So let's go into the src/lib.rs file. We'll modify this file until it looks like this: use cxx_qt::make_qobject; #[make_qobject]
mod my_object { #[derive(Default)] pub struct Data { number: i32, string: String, } #[derive(Default)] struct RustObj; use cxx_qt_lib::QString; impl RustObj { #[invokable] fn increment_number(&self, cpp: &mut CppObj) { cpp.set_number(cpp.number() + 1); } #[invokable] fn say_hi(&self, string: &QString, number: i32) { let s: String = string.into(); println!("Hi from Rust! String is '{}' and number is {}", s, number); } }
} This is a lot to take in, so let's go one step at a time. Starting with the module definition: use cxx_qt::make_qobject; #[make_qobject]
mod my_object { Because we add the #[make_qobject] macro to the module definition, CXX-Qt will create a new QObject subclass from this module. The new QObject subclass in our case will be named MyObject, as CXX-Qt automatically converts Rusts snake_case to the Qt default PascalCase. CXX-Qt is all about idiomatic code in both Rust and C++, so it will do its best to keep styling consistent for C++ and Rust as well. For the #[make_qobject] macro to work, we first need to define the data that will live in the new C++ object. This is done with the Data struct: #[derive(Default)] pub struct Data { number: i32, string: String, } That means the newly created QObject subclass will have two properties as members: number and string. For names that contain multiple words, like my_number, CXX-Qt will again perform the snake_case to camelCase conversion to fit with C++/QML naming conventions. Note that the data types we use here are normal Rust data types. CXX-Qt will automatically convert these types to their C++/Qt equivalent. In our case that means: number: i32 -> int number string: String -> QString string For more details on the available types, see the Qt types page . You might have also noticed the #[derive(Default)] here. Currently the Data struct needs to always be default-constructable. The data returned by the implementation of Default will be converted to the appropriate C++ types and assigned to the properties of any newly-constructed MyObject instance. Alternatively, we could also provide our own Default implementation for Data. Now that we've defined the data that will live on the C++ side of things, let's take a look at the Rust side: #[derive(Default)] struct RustObj; In our case, this is just an empty struct. However, the RustObj could contain any data we want. It is not converted into a C++ class, so it isn't limited to the Qt-compatible types that the Data struct is. An important point to note here is that the RustObj, like the Data struct must implement the Default trait. Every instance of the MyObject class will automatically create a corresponding RustObj instance by using the Default trait. Just because the RustObj struct doesn't contain any data, that still doesn't mean its not an important part of our MyObject class. That is because it actually defines the behavior of our class through its impl: use cxx_qt_lib::QString; impl RustObj { #[invokable] fn increment_number(&self, cpp: &mut CppObj) { cpp.set_number(cpp.number() + 1); } #[invokable] fn say_hi(&self, string: &QString, number: i32) { let s: String = string.into(); println!("Hi from Rust! String is '{}' and number is {}", s, number); } } In our case, we define two new functions: increment_number Increments the number of the MyObject. As the number lives on the C++ side, it uses a CppObj wrapper which is generated by CXX-Qt and has the appropriate setters and getters for each property. The name will be converted to incrementNumber in C++. say_hello Prints a provided number and string. It takes a reference to a QString, which needs to be converted to a Rust String first. The name will be converted to sayHello in C++. Both functions are marked with the #[invokable] macro, which means the functions will be added to the C++ code of MyObject and will be callable from QML as well. Apart from functions marked with the #[invokable] macro, the RustObj impl is just a normal Rust struct impl and can contain normal Rust functions, which the invokable functions can call as usual. And that's it. We've defined our first QObject subclass in Rust. That wasn't so hard, was it? Now let's get to using it in Qt .

