After defining our first CXX-Qt module , we're ready to create our Qt application and export our new MyObject class to QML. The easiest way to do this is to add a main.cpp file next to our lib.rs file in the src folder. #include <QtGui/QGuiApplication>
#include <QtQml/QQmlApplicationEngine> #include "cxx-qt-gen/include/my_object.h" int
main(int argc, char* argv[])
{ QGuiApplication app(argc, argv); QQmlApplicationEngine engine; const QUrl url(QStringLiteral("qrc:/main.qml")); QObject::connect( &engine, &QQmlApplicationEngine::objectCreated, &app, [url](QObject* obj, const QUrl& objUrl) { if (!obj && url == objUrl) QCoreApplication::exit(-1); }, Qt::QueuedConnection); qmlRegisterType<cxx_qt::my_object::MyObject>( "com.kdab.cxx_qt.demo", 1, 0, "MyObject"); engine.load(url); return app.exec();
} This C++ file creates a basic Qt application and executes it. If you're unfamiliar with this, I recommend you take a look at the Qt documentation . There are two notable changes compared to a normal Qt application though: #include "cxx-qt-gen/include/my_object.h" qmlRegisterType<cxx_qt::my_object::MyObject>( "com.kdab.cxx_qt.demo", 1, 0, "MyObject"); For every QObject subclass that we define in Rust, CXX-Qt will generate a corresponding C++ class. This class is included by the first code snippet. They will always be in the cxx-qt-gen/include/ include path and use the snake_case naming convention. The second code snippet then exports the class to QML. This works the same as it would for any other QObject subclass, as that is exactly what MyObject is, as far as Qt is concerned. The only thing to note here is that the class is generated in the cxx_qt::my_object namespace. Where my_object is the name of the Rust module we defined earlier. As we later want to include our QML GUI in a main.qml file inside the Qt resource system , we'll have to add a qml.qrc file in the src folder as well: <RCC version="1.0"> <qresource prefix="/"> <file>main.qml</file> </qresource>
</RCC> And that's it. We can now use our cool new class from QML .

