As noted in the QObjects in Rust chapter, we always want to use "the right tool for the right job". For a small modern GUI in Qt, that definitely means using QML. It's powerful, flexible, declarative, and allows us to iterate very quickly. So let's add a main.qml next to our two other files in the src folder: import QtQuick 2.12
import QtQuick.Controls 2.12
import QtQuick.Window 2.12 import com.kdab.cxx_qt.demo 1.0 Window { height: 480 title: qsTr("Hello World") visible: true width: 640 MyObject { id: myObject number: 1 string: "My String with my number: " + myObject.number } Column { anchors.fill: parent anchors.margins: 10 spacing: 10 Label { text: "Number: " + myObject.number } Label { text: "String: " + myObject.string } Button { text: "Increment Number" onClicked: myObject.incrementNumber() } Button { text: "Say Hi!" onClicked: myObject.sayHi(myObject.string, myObject.number) } }
} If you're not familiar with QML, I recommend you take a look at the Qt QML intro . This code will create a pretty simple GUI that consists of two Labels and two Buttons. The important part here is the use of the MyObject type. As you can see, the class we defined earlier is now usable in QML. As it is just another QObject subclass, it can be used in Qts property binding system, as is done with the myObject.string, which is bound to myObject.number. The labels then simply display the data defined in the MyObject class. We can use the two buttons to interact with the MyObject instance. As you can see here, CXX-Qt has converted the snake_case of the function names to camelCase - incrementNumber and sayHi. This way the MyObject doesn't seem at all out of place in QML. It is again important to emphasize here that MyObject is just another QObject subclass and can be used just like any other QObject subclass. The only difference being that any invokable functions that are defined are defined in Rust, instead of C++. For QML, this doesn't make a difference though. But enough of that, let's get this project building and running .

