To achieve safe multi-threading on the Rust side we use an UpdateRequester. Where the Rust thread is started (eg an invokable) the UpdateRequester should be cloned into the thread. Then when the background thread needs to update a value in the Qt object it requests an update, this is posted into the same queue as above. Once the event loop occurs this calls UpdateRequestHandler in the RustObj Handlers so that you can safely call setters or emit signals from the Qt thread and synchronise your state to the foreground. We recommend using a channel in the thread to send enums or values which are then processed in UpdateRequestHandler. Below is a complete Rust example of a multi-threaded object. #[make_qobject]
mod website { use futures::{ channel::mpsc::{UnboundedReceiver, UnboundedSender}, executor::block_on, FutureExt, StreamExt, }; use futures_timer::Delay; use std::{ sync::atomic::{AtomicBool, Ordering}, thread, time::Duration, }; enum Event { TitleArrived(String), } pub struct Data { url: String, title: String, } impl Default for Data { fn default() -> Self { Self { url: "known".to_owned(), title: "Press refresh to get a title...".to_owned(), } } } struct RustObj { event_sender: UnboundedSender<Event>, event_queue: UnboundedReceiver<Event>, loading: AtomicBool, } impl Default for RustObj { fn default() -> Self { let (event_sender, event_queue) = futures::channel::mpsc::unbounded(); Self { event_sender, event_queue, loading: AtomicBool::new(false), } } } impl RustObj { #[invokable] fn change_url(&self, cpp: &mut CppObj) { let url = cpp.url().to_rust(); let new_url = if url == "known" { "unknown" } else { "known" }; cpp.set_url(&new_url.to_unique_ptr()); } #[invokable] fn refresh_title(&self, cpp: &mut CppObj) { // TODO: SeqCst is probably not the most efficient solution let new_load = self.loading .compare_exchange(false, true, Ordering::SeqCst, Ordering::SeqCst); if new_load.is_err() { println!("Skipped refresh_title request, because already in progress."); return; } cpp.set_title(&"Loading...".to_unique_ptr()); let url = cpp.url().to_rust(); // Retrieve the update requester from the CppObj let update_requester = cpp.update_requester(); let event_sender = self.event_sender.clone(); let fetch_title = async move { // Simulate the delay of a network request with a simple timer Delay::new(Duration::from_secs(1)).await; let title = if url == "known" { "Known website" } else { "Unknown website" }; event_sender .unbounded_send(Event::TitleArrived(title.to_owned())) .unwrap(); // Request an update from the background thread update_requester.request_update(); }; thread::spawn(move || block_on(fetch_title)); } fn process_event(&mut self, event: &Event, cpp: &mut CppObj) { match event { Event::TitleArrived(title) => { cpp.set_title(&title.to_unique_ptr()); self.loading.store(false, Ordering::Relaxed); } } } } impl UpdateRequestHandler<CppObj<'_>> for RustObj { fn handle_update_request(&mut self, cpp: &mut CppObj) { while let Some(event) = self.event_queue.next().now_or_never() { if let Some(event) = event { self.process_event(&event, cpp); } } } } impl PropertyChangeHandler<CppObj<'_>, Property> for RustObj { fn handle_property_change(&mut self, cpp: &mut CppObj, property: Property) { match property { Property::Url => self.refresh_title(cpp), Property::Title => println!("title changed"), _ => unreachable!(), } } }
}

