Rust Qt objects can be nested as properties or parameters of each other. A nested object is referred to by it's path relative to crate and then CppObj as the last segment. Eg crate::mymod::secondary_object::CppObj refers a mymod.rs which contains a module secondary_object with CXX-Qt macros . To use this as a property in another object write secondary_object: crate::mymod::secondary_object::CppObj as the property. For use as a parameter in an invokable write secondary_object: &mut crate::mymod::secondary_object::CppObj as the parameter. Then the secondary_object parameter can be used via the normal CppObj methods. The following example shows a nested object as a property and parameter. #[make_qobject]
mod nested { #[derive(Default)] pub struct Data { nested: crate::rust_obj_invokables::rust_obj_invokables::CppObj, } #[derive(Default)] struct RustObj; impl RustObj { #[invokable] fn nested_parameter( &self, nested: &mut crate::rust_obj_invokables::rust_obj_invokables::CppObj, ) { println!("Number: {}", nested.number()); // TODO: we can't reach the nested object's RustObj yet // for this we will need `nested.borrow_rust_obj()` later // https://github.com/KDAB/cxx-qt/issues/30 } #[invokable] fn nested_take_give(&self, cpp: &mut CppObj) { // We now own the nested object and QML would be null // // TODO: should this return a OwnedCppObj which derefs to the CppObj ? // (so that we don't need to do the CppObj::new(obj)) // and holds the UniquePtr internally so that OwnedCppObj can be moved back in the give ? // https://github.com/KDAB/cxx-qt/issues/30 let mut nested = cpp.take_nested(); crate::rust_obj_invokables::rust_obj_invokables::CppObj::new(nested.pin_mut()) .set_number(10); // The nested object is now back in QML cpp.give_nested(nested); } }
} Note that nested objects cannot be used as return types yet ( https://github.com/KDAB/cxx-qt/issues/66 ). Note that nested objects are ignored from (de)serialisation ( https://github.com/KDAB/cxx-qt/issues/35 ). Note that nested objects cannot be used in signals ( https://github.com/KDAB/cxx-qt/issues/73 ). Note that we may allow for super:: to be used in the future ( https://github.com/KDAB/cxx-qt/issues/44 ). TODO: once we have borrow_rust_obj() explain it's purpose of reaching the other objects RustObj https://github.com/KDAB/cxx-qt/issues/30 ).

